import React from "react";
import { MdDesktopMac } from "react-icons/md";
import styled from "styled-components";
import PText from "./PText";

const ItemStyles = styled.div`
  text-align: center;
  .servicesItem__icon {
    svg {
      width: 3rem;
    }
  }
  .servicesItem__title {
    font-size: 2.5rem;
    font-family: "Montserrat SemiBold" ß;
  }
  .para {
    margin-top: 2rem;
  }
`;
export default function ServicesSectionItem({ 
    icon = <MdDesktopMac />,
    title = 'web design',
    desc = "I am 21 year old, upcoming freelance web developer. Currently, I am a junior computer science major at Clemson University. I love to design and, make new web applications for my clients",
}) {
  return (
    <ItemStyles>
      <div className="servicesItem__icon">
        {icon}
        <div className="servicesItem__title">
        {title} </div>
          <PText> {desc} </PText>

      </div>
    </ItemStyles>
  );
}
